const About = () => {

	const displayForm = () => {
		return (
			<form>
				<div className="form-group">
					<label className="form-control">Name</label>
					<input className="form-control" type="text" placeholder="Your name" />
				</div>

			</form>
		)
	}



	return (
		<div>{displayForm()}</div>
	)
}

export default About
